import React from "react";

const boxDimensions = {
  width: "250px",
  height: "50px",
  border: "1px solid teal",
};

export const SpinnerBox = ({ name, currentName }) => {
  let variable = name;
  console.log(variable);
  if (variable === currentName) {
    console.log("We got i", variable);
  }
  return (
    <div
      className={`box absolute z-10  text-white text-xl flex items-center justify-center`}
      key={name}
      //   className={`box absolute z-10  text-white text-xl flex items-center justify-center ${
      //     currentName === "Alex" ? "bg-red-400" : "bg-indigo-400"
      //   }`}
      style={boxDimensions}
    >
      {name}
    </div>
  );
};
